INSERT INTO `tb_informasi` (`id`, `user_id`, `kategori_id`, `slug`, `title`, `cover`, `konten`, `publisher`, `created_at`, `updated_at`) VALUES
(2, NULL, 1, 'masyarakat-jangan-terjebak-beli-genose-lewat-situs-belanja-online', 'Masyarakat Jangan Terjebak Beli GeNose Lewat Situs Belanja Online', 'kegiatan/Vg6hRrGas9uowbjbFst6RjAEICsSpnbXiGWGSbxh.jpg', '<p><img alt=\"\" class=\"img-fluid\" src=\"data:image/jpeg;base64,\" /></p>\r\n\r\n<p style=\"text-align: justify;\">Alat skrining Covid-19 karya UGM, GeNose C19, dari hari ke hari kian menjadi primadona dan diperbincangkan masyarakat. Banyak dari mereka yang mengapresiasi GeNose C19 karena lebih praktis, tidak sakit dan murah dibanding alat skrining Covid-19 lainnya. Sayangnya, usai memperoleh izin edar dan dipasarkan, beberapa pihak justru mengambil keuntungan dari GeNose terutama tentang penetapan harga jual di pasaran yang beragam. Salah satunya seperti yang dijual di salah satu situs belanja online tanah air baru-baru.</p>\r\n\r\n<p style=\"text-align: justify;\">&ldquo;Di sana terlihat GeNose dijual dengan harga beragam. Ada yang 75, 80 bahkan 90 juta,&rdquo;papar Dr Hargo Utomo, MBA., Direktur Direktorat Pengembangan Usaha dan Inkubasi UGM, Selasa (2/2).</p>\r\n\r\n<p style=\"text-align: justify;\">Hargo menegaskan distribusi GeNose sudah dikelola oleh PT Swayasa Prakarsa. Saat ini telah ada 3 distributor resmi GeNose C19 dan menyusul 3 distributor lainnya. Hargo juga menjelaskan Harga Eceran Tertinggi (HET) GeNose sebesar Rp 62 juta per unit (sebelum dikenakan pajak).</p>\r\n\r\n<p style=\"text-align: justify;\">&ldquo;Harganya sudah ditentukan dan tidak diperbolehkan menjual di atas harga tersebut,&rdquo;tegas Hargo.</p>\r\n\r\n<p style=\"text-align: justify;\">Untuk itu Hargo berharap agar masyarakat berhati-hati dan waspada dengan tawaran untuk membeli GeNose selain melalui distributor resmi yang ditunjuk. Saat ini, GeNose juga belum ditawarkan melalui situs belanja online.</p>\r\n\r\n<p style=\"text-align: justify;\">Hargo yang juga mewakili UGM Science Techno Park menambahkan pemasaran GeNose C19 saat ini diprioritaskan untuk penanggulangan Covid-19 pada layanan kesehatan, rumah sakit, layanan publik, pemerintahan, sekolah, pesantren, kampus dan perusahaan/industri.</p>\r\n\r\n<p style=\"text-align: justify;\">&ldquo;Dalam tahap ini belum diprioritaskan untuk skala rumah tangga atau perseorangan,&rdquo;pungkasnya.</p>', 'Satria', '2021-02-03 00:17:10', '2021-02-03 00:17:10');
INSERT INTO `tb_informasi` (`id`, `user_id`, `kategori_id`, `slug`, `title`, `cover`, `konten`, `publisher`, `created_at`, `updated_at`) VALUES
(5, NULL, 6, 'persyaratan-ppdb-2021', 'Persyaratan PPDB 2021', 'ppdb/OnkYkiAfQiUKz0YPDoQvzEomPDd5YGOHZPHTdgKC.jpg', '<p style=\"margin-bottom:11px\"><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><b>SYARAT PENDAFTARAN</b></span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1. Mengisi formulir pendaftaran online/offline</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">2. Mengumpulkan SKHUNS</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">3. Menyerahkan DANEM asli/fotokopi</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">4. Menyerahkan foto 3x4 2 lembar</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">5. Pendaftaran tidak dikenakan biaya</span></span></span></p>\r\n\r\n<p style=\"margin-bottom:11px\"><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">6. Persyaratan yang lain menyusul setelah anda menjadi siswa SMK PGRI 2 Wonogiri</span></span></span></p>\r\n\r\n<p style=\"margin-bottom:11px\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:11px\"><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><b>JALUR PENDAFTARAN</b></span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1. Jalur reguler (2 Seragam Gratis)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">2. Jalur siswa prestasi (2 Seragam Gratis dan Bebas SPP 3 Bulan)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">3. Jalur Yatim Piatu (2 Seragam Gratis dan Potongan SPP 25% sampai dengan 50%)</span></span></span></p>\r\n\r\n<p style=\"margin-bottom:11px\"><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">4. Jalur beasiswa tidak mampu (2 Seragam Gratis dan Potongan SPP 50%)</span></span></span></p>\r\n\r\n<p><img alt=\"\" class=\"img-fluid\" src=\"data:image/jpeg;base64,\" /></p>', 'Yusril Ihza', '2021-02-04 03:45:13', '2021-02-05 06:06:14');

