INSERT INTO `tb_profil` (`id`, `title`, `konten`, `created_at`, `updated_at`) VALUES
(1, 'PROFIL SEKOLAH SMKS PGRI 2 WONOGIRI', '<p><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><b>PROGRAM KEAHLIAN</b></span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><i>Teknik Kendaraan Ringan </i></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Program Teknik Kendaraan Ringan (OTOMOTIF) yang didesain untuk menghasilkan tenaga yang mampu menerapkan dan mengembangkan pengetahuan dan keterampilan di bidang otomotif sehingga mampu bersaing dan siap sebagai tenaga kerja di bidang otomotif.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><i>Teknik Komputer dan Jaringan</i></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Program Teknik Komputer dan Jaringan di desain untuk menghasilkan tenaga yang mampu menerapkan dan mengembangkan pengetahuan dan keterampilan di bidang teknologi komputer dan jaringan sehingga mampu bersaing dan siap sebagai tenaga kerja di bidang IT.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><b>PRAKTEK KERJA LAPANGAN</b></span></span></span></p>\r\n\r\n<table class=\"MsoTableGrid\" style=\"border-collapse:collapse; border:none\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:189px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">TKR</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:189px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">TKJ</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:189px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">KENANGA MOTOR</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:189px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">TELKOM WONOGIRI</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:189px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">BINTANG MOTOR</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:189px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">CAHAYA KOMPUTER</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:189px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">PO. SEDYA MULYA</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:189px; padding: