INSERT INTO `tb_sambutan` (`id`, `title`, `konten`, `created_at`, `updated_at`) VALUES
(2, 'Sambutan Kepala Sekolah', '<p style=\"text-align: center;\"><img alt=\"\" class=\"img-fluid\" height=\"223\" src=\"data:image/png;base64,\" width=\"202\" /></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:16px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><strong>Kepala Sekolah</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Assalamu&#39;alaikum wr.wb.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Puji syukur kepada Alloh SWT, Tuhan Yang Maha Esa yang telah memberikan rahmat dan anugerahNya sehingga website SMKS PGRI 2 Wonogiri ini dapat terbit. Salah satu tujuan dari website ini adalah untuk menjawab akan setiap kebutuhan informasi dengan memanfaatkan sarana teknologi informasi yang ada. Kami sadar sepenuhnya dalam rangka memajukan pendidikan di era berkembangnya Teknologi Informasi yang begitu pesat, sangat diperlukan berbagai sarana prasarana yang kondusif, kebutuhan berbagai informasi siswa, guru, orangtua maupun masyarakat, sehingga kami berusaha mewujudkan hal tersebut semaksimal mungkin. Semoga dengan adanya website ini dapat membantu dan bermanfaat, terutama informasi yang berhubungan dengan pendidikan, ilmu pengetahuan dan informasi seputar SMKS PGRI 2 Wonogiri. Besar harapan kami, sarana ini dapat memberi manfaat bagi semua pihak yang ada dilingkup pendidikan dan pemerhati pendidikan secara khusus bagi SMKS PGRI 2 Wonogiri.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Akhirnya kami mengharapkan masukan dari berbagai pihak untuk website ini agar kami terus belajar dan meng-update diri, sehingga tampilan, isi dan mutu website akan terus berkembang dan lebih baik nantinya. Terima kasih atas kerjasamanya, maju terus untuk SMKS PGRI 2 Wonogiri&nbsp; yang lebih baik lagi.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Wassalamu&#39;alaikum wr.wb.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Hormat kami, </span></span></span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kepala SMKS PGRI 2 Wonogiri</span></span></span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">ttd</span></span></span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Suhardi S.T</span></span></span></p>', '2021-01-28 19:20:56', '2021-04-15 22:24:28');

