(4, 'Visi', '<p style=\"margin-bottom:11px\"><span style=\"font-size:12pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Terwujudnya tamatan siap kerja, kompetitif dan berkarakter.</span></span></span></p>', '2021-02-04 04:09:36', '2021-02-04 04:09:45'),
(6, 'MISI', '<table class=\"MsoTableGrid\" style=\"width:604px; border-collapse:collapse; border:none\" width=\"604\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:28px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:576px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Mendidik dan melatih peserta didik sesuai<br />\r\n			dengan kebutuhan kerja</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:28px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">2</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:576px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Mnyiapkan tamatan menjadi warga<br />\r\n			normatif, adaptif produktif dan inovatif</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:28px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">3</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:576px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Menanamkan nilai keimanan dan ketaqwaan<br />\r\n			kepada Tuhan Yang Maha Esa</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '2021-02-04 04:11:20', '2021-02-04 04:11:20'),
(7, 'ALASAN MEMILIH SMK PGRI WONOGIRI', '<table class=\"MsoTableGrid\" style=\"border-collapse:collapse; border:none\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:28px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:301px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Program Teknik Kendaraan Ringan (OTOMOTIF) mempelajari kendaraan bermotor seperti mobil dan juga sepeda motor</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:28px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">2</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:301px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Program Teknik Komputer Jaringan saat ini perusahan banyak mencari karyawan yang bisa mengoperasikan komputer</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:28px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">3</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:301px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">BKK SMK PGRI 2 Wonogiri mempunyai kerja sama dengan dunia usaha dan dunia industri yang siap menyalurkan kerja</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:28px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">4</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:301px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Letak strategis dapat dijangkau kendaraan umum semua jurusan</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:28px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">5</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:301px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Biaya sekolah yang sangat murah / Ringan</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:28px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">6</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:301px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Memiliki guru-guru pembentuk karakter siswa untuk siap kerja</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:28px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">7</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:301px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Memiliki bengkel dan lab. komputer yang memadai</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:28px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">8</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:301px; padding:0cm 7px 0cm 7px\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Memiliki HOTSPOT yang bisa diakses 24 jam</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '2021-02-05 04:20:09', '2021-02-05 04:20:09');

